export const getArrSlider = (start , end, Number) => {
    const limit = start > end 
    let output = [];
    for (let i = start; i < Number; i++) {
        output.push(i)
    }
    for (let i = 0; i <= end; i++) {
        output.push(i)
    }
    return output
}
